import React from "react";
import { Box } from "@material-ui/core";
import ProductView from "./ProductView";

const GridView = () => {
  return (
    <Box width="300px" bgcolor="white" mx="auto">
      <ProductView />
      <ProductView />
    </Box>
  );
};

export default GridView;
